		<title>pattern1</title>
		<style>
			
			body {
				background: rgb(120, 77, 74);
				margin:0px;
				}
				
			div {
				float:left;
				}
			
			
			.shape { 
				width: 50px; 
				height: 50px;
				background:solid transparent;
				position: relative;
				margin:10px;
				}
			
			.square {
				height:150px;
				width:150px;
				background: rgba(120, 77, 74, 0.22);;
				left:-50px;
				position:absolute;
				z-index: 1;
				}
				
			.rotatedSquare {
				height:100px;
				width:100px;
				position:absolute;
				border: 30px solid rgba(239, 171, 167, 0.41);
				left: 20px;
				top:20px;

				-webkit-transform:rotate(45deg);
				}
		
			.circle2 {
				height:105px;
				width:105px;
				background:rgba(167, 79, 73, 0.85);
				position:absolute;
				left:-50px;
				border-radius:100px;
				border: 10px rgba(167, 81, 49, 0.55);;
				z-index:-1;
				}
					
				

		</style>
	</head>
